import React from 'react';

import styles from './../Style/Components/Message.module.css';

type MyProps = { 
  Self:     string,
  Owner:    string,
  Username: string,
  Picture:  string,
  Content:  string
};
type MyState = { };
class Message extends React.Component<MyProps, MyState> {
  public state: MyState;
  constructor(props) {
    super(props);
  }
  render() {
    return (
      <div className={styles.Container}>

      </div>
    );
  }
}
export default Message;
